    let singleProductStr = """
        <li><a href="https://world.openfoodfacts.org/product/3017620422003/nutella-ferrero" class="list_product_a"><div class="list_product_content"><div class="list_product_img_div"><img src="https://images.openfoodfacts.org/images/products/301/762/042/2003/front_en.430.200.jpg" class="list_product_img"></div><div class="list_product_name v-space-tiny">Nutella - Ferrero - 400&nbsp;g</div><div class="list_product_sc"><img class="list_product_icons" src="https://static.openfoodfacts.org/images/attributes/nutriscore-e.svg" title="Nutri-Score E - Bad nutritional quality"><img class="list_product_icons" src="https://static.openfoodfacts.org/images/attributes/nova-group-unknown.svg" title="NOVA not computed - Food processing level unknown"></div></div></a></li>
    """
    let parser = ProductParser()
    //Parser tests
    [<Fact>]
    let ``Parser example`` () = async {
    
        let! products = parser.ParseProductsFromPage(allProductsDivStr) |> Async.AwaitTask
        let inspector = 
            fun (product:ProductDto) ->
                Assert.Null(product.Barcode)
                Assert.Null(product.Brands)
                Assert.Null(product.Categories)
                Assert.Null(product.Quantity)
                Assert.Equal(0L,product.Id)            
                Assert.Equal(ProductStatus.Draft,product.Status)
                Assert.NotEmpty(product.Url)
                Assert.NotEmpty(product.ProductName)
                Assert.NotEmpty(product.ImageUrl)
        let inspectors:Action<ProductDto> array = products |> Seq.map (fun p -> (Action<ProductDto> inspector)) |> Seq.toArray            
        Assert.NotEmpty(products)
        Assert.Collection(products,inspectors)
    }
